import React from 'react';
import menu from './data';

const Menu = ({ itmes }) => {
  return <div className='section-center'>
    {itmes.map((menuItem) => {
      const { id, title, img, desc } = menuItem;
      return (
        <article key={id} className='menu-item'>
          <img src={img} alt={title} className='photo' />
        </article>
      )
    })}

  </div>;
};

export default Menu;
